import React from "react";
import { FaFacebookF, FaTwitter, FaLinkedin } from "react-icons/fa";
import Images from "../images/logoo.png";

const Header = () => {
  return (
    <div className="flex flex-col md:flex-row items-center justify-between w-full px-5 py-3 border-b bg-white md:px-10">
      {/* Logo Section */}
      <div className="flex justify-center md:justify-start">
        <img src={Images} alt="Logo" className="w-[120px] md:w-[150px] h-auto object-contain" />
      </div>

      {/* Social Icons */}
      <div className="flex gap-4 text-blue-600 text-2xl md:text-3xl mt-3 md:mt-0">
        <a href="https://www.facebook.com" target="_blank" rel="noopener noreferrer" className="hover:text-blue-800 transition duration-300">
          <FaFacebookF />
        </a>
        <a href="https://www.twitter.com" target="_blank" rel="noopener noreferrer" className="hover:text-blue-800 transition duration-300">
          <FaTwitter />
        </a>
        <a href="https://www.linkedin.com" target="_blank" rel="noopener noreferrer" className="hover:text-blue-800 transition duration-300">
          <FaLinkedin />
        </a>
      </div>

      {/* Phone Number */}
      <a href="tel:8552295934" className="text-blue-800 font-bold text-xl md:text-2xl mt-3 md:mt-0">
        403-604-9794
      </a>
    </div>
  );
};

export default Header;
